import {BrowserRouter, Route, Routes} from "react-router-dom" 
import "./App.css";
import Dishes from "./component/Dishes";
import Header from "./layout/Header";

const App = () => {
  return (
    <BrowserRouter>
      <Header />
      <Routes>
        <Route path="/" element={<Dishes />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
